/// @title Endless Crawler Cards Store (v.3)
/// @author Studio Avante
/// @notice Contains token info for all Game Cards
/// @dev Serves CardsMinter.sol
pragma solidity ^0.8.16;
import { Ownable } from '@openzeppelin/contracts/access/Ownable.sol';
import { Base64 } from '@openzeppelin/contracts/utils/Base64.sol';
import { ICardsStore } from './ICardsStore.sol';

contract CardsStore is ICardsStore, Ownable {

	uint8 constant DATA_URL = 0;	// data is a URL
	uint8 constant DATA_SVG = 1;	// data is Base64 encoded, no mime type
	uint8 constant DATA_PNG = 2;	// data is Base64 encoded, no mime type
	uint8 constant DATA_HTML = 3;	// data is Base64 encoded, no mime type

	uint8 constant TYPE_CLASS = 1;
	uint8 constant TYPE_PAINT = 2;
	uint8 constant TYPE_SKIN = 3;
	uint8 constant TYPE_LAYER = 4;
	uint8 constant TYPE_CHARACTER = 5;
	uint8 constant TYPE_ITEM = 6;
	uint8 constant TYPE_MUSIC = 7;
	uint8 constant TYPE_GAME = 8;
	uint8 constant TYPE_RENDERER = 9;

	struct Attribute {
		bytes name;
		bytes value;
	}

	struct Card {
		uint256 tokenId;
		uint256 price; // wei
		uint128 supply;
		uint8 cardType;
		uint8 imageDataType;
		uint8 animationDataType;
		bool listed;
		bool justOne;
		bytes imageData;
		bytes animationData;
		string name;
		string description;
	}

	uint256 private _tokenId; // last minted id

	mapping(uint256 => Card) private _cards;

	mapping(uint256 => Attribute[]) private _attributes;

	event Created(uint256 indexed id, string indexed name);
	event Listed(uint256 indexed id, bool indexed listed);

	constructor() {}

	modifier ifExists(uint256 id) {
		require(exists(id), 'Card does not exist');
		_;
	}

	//---------------
	// Public
	//

	function getVersion() public pure override returns (uint8) {
		return 3;
	}

	function exists(uint256 id) public view override returns (bool) {
		return (id > 0 && _cards[id].tokenId == id);
	}

	function getCard(uint256 id) public view ifExists(id) returns (Card memory) {
		return _cards[id];
	}

	function beforeMint(uint256 id, uint256 currentSupply, uint256 balance, uint256 value) public view override ifExists(id) {
		Card storage card = _cards[id];
		require(currentSupply < card.supply, 'Sold out');
		require(card.listed, 'Unlisted');
		require(!card.justOne || balance == 0, 'One per wallet');
		require(value >= card.price, 'Bad value');
	}

	function getCardCount() public view override returns (uint256) {
		return _tokenId;
	}

	function getCardSupply(uint256 id) public view override ifExists(id) returns (uint256) {
		return _cards[id].supply;
	}

	function getCardPrice(uint256 id) public view override ifExists(id) returns (uint256) {
		return _cards[id].price;
	}

	function isCardListed(uint256 id) public view ifExists(id) returns (bool) {
		return _cards[id].listed;
	}

	function getAttributes(uint256 id) public view ifExists(id) returns (Attribute[] memory) {
		return _attributes[id];
	}

	function uri(uint256 id) public view override ifExists(id) returns (string memory) {
		Card storage card = _cards[id];
		bytes memory json = abi.encodePacked(
			'{'
				'"name":"', card.name, '",'
				'"description":"', card.description, '",'
				'"external_url":"https://endlesscrawler.io",'
				'"background_color":"000000",'
				'"attributes":[', _renderAttributes(id), ']',
				_renderDataProperty('image', card.imageDataType, card.imageData),
				_renderDataProperty('animation_url', card.animationDataType, card.animationData),
			'}'
		);
		return string(abi.encodePacked('data:application/json;base64,', Base64.encode(json)));
	}

	//---------------
	// Internal
	//

	function _renderAttributes(uint256 id) internal view returns (bytes memory result) {
		for (uint i = 0; i < _attributes[id].length; ++i) {
			if (_attributes[id][i].value.length > 0) {
				if(result.length > 0) {
					result = bytes.concat(result, ',');
				}
				result = bytes.concat(result,
					'{"trait_type":"', _attributes[id][i].name, '","value":"', _attributes[id][i].value, '"}'
				);
			}
		}
	}

	function _renderDataProperty(bytes memory propName, uint8 dataType, bytes storage data) internal view returns (bytes memory result) {
		if(data.length > 0) {
			result = bytes.concat(',"', propName, '":"');
			if (dataType == DATA_SVG) {
				result = bytes.concat(result, 'data:image/svg+xml;base64,', data, '"');
			} else if (dataType == DATA_PNG) {
				result = bytes.concat(result, 'data:image/png;base64,', data, '"');
			} else if (dataType == DATA_HTML) {
				result = bytes.concat(result, 'data:text/html;base64,', data, '"');
			} else { // DATA_URL
				result = bytes.concat(result, data, '"');
			}
		}
	}

	//---------------
	// Admin
	//

	function list(uint256 id, bool listed) public onlyOwner ifExists(id) {
		if(_cards[id].listed != listed) {
			_cards[id].listed = listed;
			emit Listed(id, listed);
		}
	}

	function createCard(
		string memory name,
		string memory description,
		uint256 pwei,
		uint256 supply,
		bool justOne,
		uint8 imageDataType,
		uint8 animationDataType,
		bytes calldata imageData,
		bytes calldata animationData
	) public onlyOwner returns (uint256) {
		_tokenId++;
		_cards[_tokenId] = Card(
			_tokenId,
			pwei * 1_000_000_000_000_000, // to wei
			uint128(supply),
			TYPE_CLASS,
			imageDataType,
			animationDataType,
			false, // listed
			justOne,
			imageData,
			animationData,
			name,
			description
		);
		emit Created(_tokenId, name);
		return _tokenId;
	}

	function addAttributes(
		uint256 id,
		string[] calldata names,
		string[] calldata values
	) public onlyOwner ifExists(id) returns (uint256) {
		require(names.length == values.length, 'Names != Values');
		for (uint i = 0; i < names.length; ++i) {
			_attributes[id].push(
				Attribute(bytes(names[i]), bytes(values[i]))
			);
		}
		return _attributes[id].length;
	}

	function editAttributes(
		uint256 id,
		string[] calldata names,
		string[] calldata values
	) public onlyOwner ifExists(id) {
		require(names.length == values.length, 'Names != Values');
		for (uint i = 0; i < names.length; ++i) {
			bytes32 nameHash = keccak256(bytes(names[i]));
			for (uint j = 0; j < _attributes[id].length; ++j) {
				if (keccak256(_attributes[id][j].name) == nameHash) {
					_attributes[id][j].value = bytes(values[i]);
					break;
				}
			}
		}
	}

}
